  \"Optimal Shockwave Boundary Layer Interaction Control for Supersonic Mixed Compression
  Inlets Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T21:24:04.118062\",\n\t\"name\": \"optimal-shockwave-boundary-layer-interaction-control-for-supersonic-mixed-compression-inle\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"SynGenics Corporation proposes a program
  that incorporates systems engineering processes, Response Surface Methods, and state-of-the-art
  numerical methods to develop optimized, fail safe technologies to control shockwave
  boundary layer interactions and demonstrate improvements in supersonic mixed compression
  inlet performance. Specific program objectives are to apply structured, mathematically
  based methods to evaluate, compare, rate, and downselect flow control concepts that
  will enable improved inlet stability and control shockwave boundary layer interactions
  in supersonic, mixed compression inlets, to develop and demonstrate an approach
  to flow control system design and optimization based on designed experiments and
  response surface methodology, and to obtain a better understanding of the physics
  driving supersonic inlet performance improvements enabled by fail safe, supersonic
  inlet flow control and quantify the benefit in terms of inlet total pressure recovery
  and dynamic distortion.rnThe significance of this program is that it will provide
  inlet system-level assessments of flow control technologies, including stationary
  micro-devices, active devices, and hybrid systems comprised of stationary and active
  devices. In addition, this program will quantify flow control effectiveness in terms
  of total pressure recovery and distortion computed at the inlet/engine aerodynamic
  interface plane. This program supports the Propulsion Efficiency key research area
  of the NASA Fundamental Aeronautics Supersonics Program by working to develop fail
  safe inlet flow control technologies that will facilitate low TSFC of highly integrated
  supersonic inlets and improved overall cruise efficiency through reduced inlet drag.\",\n\t\"license_title\":
